import ListGroup from "./ListGroup";

function Home() {
  const names = [
    'New York',
    'San Francisco',
    'Tokyo',
    'London',
    'Paris'
];
  const name = '';
  if (name)
    return <h1>Hello {name}</h1>;
  return <div>
      <h1>Hello World</h1>
      <ListGroup/>
    </div>;
}
export default Home;
